import './Links.css'
function Links(props) {
  const job = [
    {
      decription: "Visit my github account to see the projects I've made.",
      icon: "../icons/github.svg"
    },
    {
      decription: "",
      icon: ""
    }
  ]
  return (
    <>
      {
        job.map((element, i) => {
          return (
            <div className="link-container">
              <div className="link-container-description">
                <p>{element.decription}</p>
              </div>
              <img className="link-container-arrow" alt='arrow' />
              <img className="link-container-icon" src='../icons/github.svg"' alt='github'/>
            </div>
          )
        })
      }
    </>
  )
}

export default Links
